import img1 from '../assets/1.png';
import img2 from '../assets/2.png';
import img3 from '../assets/3.png';
import img4 from '../assets/4.png';

export const data = [
    {
        id: 1,
        image: `${img1}`,
        name: 'Producto 1',
        description: 'Producto 2',
        quantity: 1,
    },
    {
        id: 2,
        image: `${img2}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    },
    {
        id: 3,
        image: `${img3}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    },
    {
        id: 4,
        image: `${img4}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    }
]
